// IE8+
if (!jQuery.support.cors && jQuery.ajaxTransport && window.XDomainRequest) {
    var httpRegEx = /^https?:\/\//i;
    var getOrPostRegEx = /^get|post$/i;
    var sameSchemeRegEx = new RegExp('^'+location.protocol, 'i');
    var htmlRegEx = /text\/html/i;
    var jsonRegEx = /\/json/i;
    var xmlRegEx = /\/xml/i;

    // ajaxTransport exists in jQuery 1.5+
    jQuery.ajaxTransport('text html xml json', function(options, userOptions, jqXHR){
        // XDomainRequests must be: asynchronous, GET or POST methods, HTTP or HTTPS protocol, and same scheme as calling page
        if (options.crossDomain && options.async && getOrPostRegEx.test(options.type) && httpRegEx.test(options.url) && sameSchemeRegEx.test(options.url)) {
            var xdr = null;
            var userType = (userOptions.dataType||'').toLowerCase();
            return {
                send: function(headers, complete){
                    xdr = new XDomainRequest();
                    if (/^\d+$/.test(userOptions.timeout)) {
                        xdr.timeout = userOptions.timeout;
                    }
                    xdr.ontimeout = function(){
                        complete(500, 'timeout');
                    };
                    xdr.onload = function(){
                        var allResponseHeaders = 'Content-Length: ' + xdr.responseText.length + '\r\nContent-Type: ' + xdr.contentType;
                        var status = {
                            code: 200,
                            message: 'success'
                        };
                        var responses = {
                            text: xdr.responseText
                        };
                        try {
                            if (userType === 'html' || htmlRegEx.test(xdr.contentType)) {
                                responses.html = xdr.responseText;
                            } else if (userType === 'json' || (userType !== 'text' && jsonRegEx.test(xdr.contentType))) {
                                try {
                                    responses.json = jQuery.parseJSON(xdr.responseText);
                                } catch(e) {
                                    status.code = 500;
                                    status.message = 'parseerror';
                                    //throw 'Invalid JSON: ' + xdr.responseText;
                                }
                            } else if (userType === 'xml' || (userType !== 'text' && xmlRegEx.test(xdr.contentType))) {
                                var doc = new ActiveXObject('Microsoft.XMLDOM');
                                doc.async = false;
                                try {
                                    doc.loadXML(xdr.responseText);
                                } catch(e) {
                                    doc = undefined;
                                }
                                if (!doc || !doc.documentElement || doc.getElementsByTagName('parsererror').length) {
                                    status.code = 500;
                                    status.message = 'parseerror';
                                    throw 'Invalid XML: ' + xdr.responseText;
                                }
                                responses.xml = doc;
                            }
                        } catch(parseMessage) {
                            throw parseMessage;
                        } finally {
                            complete(status.code, status.message, responses, allResponseHeaders);
                        }
                    };
                    // set an empty handler for 'onprogress' so requests don't get aborted
                    xdr.onprogress = function(){};
                    xdr.onerror = function(){
                        complete(500, 'error', {
                            text: xdr.responseText
                        });
                    };
                    var postData = '';
                    if (userOptions.data) {
                        postData = (jQuery.type(userOptions.data) === 'string') ? userOptions.data : jQuery.param(userOptions.data);
                    }
                    xdr.open(options.type, options.url);
                    xdr.send(postData);
                },
                abort: function(){
                    if (xdr) {
                        xdr.abort();
                    }
                }
            };
        }
    });
}


//Site Scripts

var apiURL = 'http://www.westfield.com.au/api/';
var statesAPI = apiURL + 'centre/master/states.json?country=';
var centresAPI = apiURL + 'centre/master/centres.json?state=';
var dealsAPI = apiURL + 'deal/master/deals.json?state=published&centre=';

jQuery.noConflict();
(function($) {
    $(function() {

        function formatDate(date){
            var dateObject = new Date(date);
            return dateObject.getMonth() + '/' + dateObject.getDay() + '/' + dateObject.getFullYear();
        }


        function showStates(country) {
            // Creates the Nav

            var query = country;
            if (!query) {
                query = 'au';
            }
            $.getJSON(statesAPI+query, function( data ) {
                var items = [];
                $.each( data, function( key, state ) {
                    // only show these states
                    var array=[0,1,3,4,6,7];
                    var selected = '';
                    if($.inArray(key, array) > -1) {
                        if (key == 0) { selected = " selected"; };
                        items.push( "<li id='" + state.abbreviation + "' class='state" + selected + "'>" + state.abbreviation + "</li>" );
                    }
                });
                $( "<ul/>", {
                    "id": "stateNav",
                    html: items.join( "" )
                }).appendTo( "#top" );
            });
        }

        function showCentres(state) {
            // Shows the Centres

            var query = state;
            if (!query) {
                query = 'NSW';
            }
            $.getJSON(centresAPI+query, function( data ) {
                var items = [];
                $.each( data, function( key, centre ) {
                    var centerID = "centre" + key;
                    items.push( "<h2 style='clear: both;' id='" + centre.code + "'>" + centre.short_name + "</h2><div class='" + centre.code + "' class='" + centerID + "'> </div>" );
                });
                $( "<div/>", {
                    "id": "centres",
                    html: items.join( "" )
                }).delay(500).appendTo( "#results" );
                $( "#centres").accordion({ active: false, animate: 200, collapsible: true });
            });
        }

        function showDeals(centre) {
            // Shows the Deals

            var query = centre;
            var location = "." + query;
            $(location).empty();

            $.getJSON(dealsAPI+query, function( data ) {
                var items = [];
                $.each( data, function( key, deal ) {
                    var image_ref = '_i/no_img.png'
                    if (deal.image_ref != null) {
                        image_ref = deal.image_ref;
                    }
                    var linkSRC = deal.external_url;
                    var linkTXT = "View more";
                    var theLink;
                    if (null == linkSRC || linkSRC == '') {
                        // this should really be no link found, but for the demo
                        // just hardcoding something
                        // theLink = "No external link found";
                        theLink = '<a href="TK">' + linkTXT + '</a>';
                    } else {
                        theLink = '<a href="' + linkSRC + '">' + linkTXT + '</a>';
                    }

                    items.push( "<li class='deal'>" +
                        "<div class='img'><img src='" + image_ref + "' width='104' height='79'></div>" +
                        "<div class='info'><h3>" + deal.title + "</h3><p>Deal from " + formatDate(deal.available_from) + " to " + formatDate(deal.available_to) + "</p></div>" +
                        "<div class='link'><p>" + theLink + "<span></span></p></div>" +
                        "</li>" );
                });

                if (items.length == 0) {
                    items.push( "<li class='deal nodeal'>" +
                        "<div class='info'><h3>No deals at this centre</h3><p>Check nearby centres</p></div>" +
                        "</li>" );
                }
                $( "<ul/>", {
                    "id": "deals",
                    html: items.join( "" )
                }).delay(500).appendTo(location);
                $(".ui-accordion-content-active").css({"height": "100%"})
            });
        }

        // Set up page
        // showStates();
        showCentres();

        var searchReplace = 'Search for deals...';

        // Switch states
        $(document).on('click', '#stateNav a', function() {
            var state = $(this).attr('id');
            $("#centres").remove();
            // this is just removing the fake search content
            $('#fakeResults').hide();
            $('#top input[type=text]').val(searchReplace);
            $("#stateNav li.selected").toggleClass('selected');
            $(this).find('li').toggleClass('selected');
            showCentres(state);
            return false;
        });

        // Show Deals when Accordion is clicked
        $(document).on('click', '#centres h2', function() {
            var centre = $(this).attr('id');
            showDeals(centre);
        });

        $('#top input[type=text]').click(function() {
            $(this).val('');
        });
        $('#top input[type=text]').focusout(function() {
            if ($(this).val() == '') {
                $(this).val(searchReplace);
            }
        });

        $('#top form').submit(function() {
            var searchTerm = $('#top input[type=text]').val();
            $("#centres").remove();
            $('#fakeResults h2 span').text(searchTerm);
            $('#fakeResults').fadeIn();
            return false;
        });


    });
})(jQuery);